B.Uo=new A.a7("Persona natural o jur\xeddica que realiza t\xe9cnicamente procesos de fabricaci\xf3n, formulaci\xf3n, envasado o empaque de un producto, a partir de materias primas de origen local.\n\nPuede ser un productor de cultivos agr\xedcolas, o criador de ganados como gallinas, patos, vacas, cabras, conejos, entre otros. Pero tambi\xe9n puede ser una persona que transforma materias primas agr\xedcolas o pecuarias en productos comerciales, como chocolates, carnes embutidas, quesos, caf\xe9 tostado y molido, etc.\n\nTambi\xe9n esta palabra aplica para las personas que transforman biomasas residuales, sobrantes de cosechas en abonos org\xe1nicos en una biof\xe1brica.\n",null,B.d7,B.a4,null,null,null,null,null)
