B.Up=new A.a7("Microorganismos que pueden provocar enfermedades a las plantas, animales y humanos, como los virus, bacterias y hongos, entre otros.\n\nEstos pat\xf3genos no solo se tienen referencia a los que se pueden presentar en las actividades normales de los cultivos, tambi\xe9n a los que se pueden generar en los procesos de la biof\xe1brica, por el origen de la materia prima o por un mal manejo de los procesos de composta, maduraci\xf3n, fermentaci\xf3n entre otras actividades.\n\nUn ejemplo, es el control de la temperatura en compostas, que busca garantizar la eliminaci\xf3n de pat\xf3genos nocivos y la obtenci\xf3n de un producto final seguro y de alta calidad. Durante el proceso de compostaje, temperaturas sostenidas entre 55 \xb0C y 65 \xb0C son ideales para destruir microorganismos perjudiciales, huevos de par\xe1sitos y semillas de malezas sin comprometer la actividad de los microorganismos ben\xe9ficos. Este rango t\xe9rmico asegura una descomposici\xf3n eficiente, la estabilizaci\xf3n de la materia org\xe1nica, reduciendo riesgos sanitarios asociados al uso del compost en cultivos. Adem\xe1s, monitorear y mantener temperaturas adecuadas previene la generaci\xf3n de condiciones anaer\xf3bicas que ralentizan el proceso y genera malos olores.\n",null,B.d7,B.a4,null,null,null,null,null)
B.Ll=new A.be(B.cP,B.Up,null)
B.V3=new A.a7("Agente pat\xf3geno da\xf1ino para las plantas o productos vegetales, de cualquier especie, raza o biotipo vegetal o animal.\n\nEn este concepto tambi\xe9n se consideran las arvenses espont\xe1neas que se presentan en los cultivos y que pueden representar una competencia nutricional con la siembra principal, pero que se deben manejar de acuerdo con el criterio agroecol\xf3gico del plan de manejo integrado del cultivo.\n\nEs necesario tener en cuenta que, en la agricultura org\xe1nica, se emplean conceptos como el Manejo Integrado de Plagas (MIP), el manejo agroecol\xf3gico de malezas o la gesti\xf3n de organismos no deseados, los cuales reflejan un enfoque sostenible y respetuoso con el medio ambiente. Estas pr\xe1cticas buscan mantener el equilibrio ecol\xf3gico mediante estrategias preventivas, biol\xf3gicas, culturales y mec\xe1nicas, promoviendo la biodiversidad funcional y minimizando la necesidad de insumos sint\xe9ticos. En lugar de erradicar plagas o malezas, se prioriza su regulaci\xf3n natural y su integraci\xf3n en un sistema productivo equilibrado.\n",null,B.d7,B.a4,null,null,null,null,null)
B.Lm=new A.be(B.cP,B.V3,null)
B.Us=new A.a7("Acci\xf3n de consumir alimentos agr\xedcolas producidos de manera local (unidad agropecuaria) para satisfacer sus necesidades alimenticias.\n\nTambi\xe9n se puede considerar autoconsumo la producci\xf3n de los biopreparados de la biof\xe1brica para el consumo en su propio sistema productivo.\n",null,B.d7,B.a4,null,null,null,null,null)
B.Ln=new A.be(B.cP,B.Us,null)
B.Ut=new A.a7("Material distinto del suelo, colocado en un contenedor en mezcla o puro, que permite el anclaje del sistema radicular desempe\xf1ando la funci\xf3n de soporte para la planta.\n\nEn la agricultura org\xe1nica, un sustrato es un material que proporciona un entorno adecuado para el desarrollo de las ra\xedces de las plantas, sirviendo como soporte f\xedsico y, en muchos casos, como fuente de nutrientes. Los sustratos en este tipo de agricultura suelen ser de origen natural, libres de sustancias qu\xedmicas sint\xe9ticas y respetuosos con el medio ambiente.\n\nSuelen emplearse compostas, humus de lombriz, fibra de coco, residuos agr\xedcolas reciclados o mezclas que mejoran la estructura y sostenibilidad del cultivo. Estos sustratos deben ser biodegradables, libres de qu\xedmicos sint\xe9ticos y adaptados a las necesidades espec\xedficas del cultivo y las condiciones locales.\n",null,B.d7,B.a4,null,null,null,null,null)
B.Lo=new A.be(B.cP,B.Ut,null)
B.UV=new A.a7("Una biof\xe1brica es una instalaci\xf3n dise\xf1ada para la producci\xf3n de biopreparados, que son insumos agr\xedcolas elaborados a partir de microorganismos, extractos vegetales u otros materiales naturales.\n\nEstas instalaciones permiten a los productores obtener alternativas sostenibles y econ\xf3micas para el manejo de plagas, enfermedades y fertilizaci\xf3n en sus cultivos.\n\nAdem\xe1s, las biof\xe1bricas promueven la agricultura sostenible al reducir la dependencia de productos qu\xedmicos sint\xe9ticos, mejorando la salud del suelo y la biodiversidad en los ecosistemas agr\xedcolas.\n",null,B.d7,B.a4,null,null,null,null,null)
B.Lp=new A.be(B.cP,B.UV,null)
B.V8=new A.a7("Sustancia utilizada en la producci\xf3n de biopreparados.\n\nCualquier recurso biol\xf3gico, org\xe1nico o mineral, obtenido de manera sostenible y de origen local, que sirve como insumo fundamental para los procesos de producci\xf3n de bioinsumos, fertilizantes, bioestimulantes, biocontroladores o productos relacionados, destinados a mejorar la productividad agr\xedcola o la sostenibilidad ambiental.\n\nEsta precisi\xf3n destaca la importancia de aprovechar recursos cercanos para fomentar la autosuficiencia, reducir la huella de carbono y fortalecer las econom\xedas locales.\n",null,B.d7,B.a4,null,null,null,null,null)
B.Lq=new A.be(B.cP,B.V8,null)
