B.U8=new A.a7("1 - Protectores: Se aplican recubriendo la parte externa de la planta y act\xfaan como una barrera contra las plagas que potencialmente puede producir la enfermedad.\n\n2 - Sist\xe9micos: Act\xfaan creando o dotando de defensas a las plantas por dentro. Son absorbidos a trav\xe9s del follaje o de las ra\xedces y se movilizan a toda la planta.\n\n3 - Bioinsecticida / biorepelente: Se preparan a base de sustancias naturales con propiedades reguladoras, de control o de eliminaci\xf3n de insectos considerados plagas para los cultivos. Se extraen de alguna planta, de los propios insectos o pueden ser de origen mineral. Los m\xe1s comunes son aquellos producidos a partir de infusiones, macerados, purines y decocciones.\n\n4 - Nutritivos: Se agregan al suelo con el objetivo de aumentar la disponibilidad y absorci\xf3n de minerales de parte de las plantas y mejorar el desarrollo de los cultivos. Estos a su vez pueden ser:\n\n",null,B.f8,B.a4,null,null,null,null,null)
B.U9=new A.a7("1. Realizar seguimiento de sus productos garantizando su calidad, eficacia e inocuidad.\n\n2. Realizar los an\xe1lisis para control interno de la calidad y tomar acciones sobre la producci\xf3n.\n\n3. Enviar antes del 30 de abril de cada a\xf1o el reporte de producci\xf3n de sus productos del a\xf1o inmediatamente anterior.\n\n4. Cumplir y mantener las condiciones t\xe9cnicas autorizadas para la producci\xf3n y evaluaci\xf3n de los biopreparados, seg\xfan el caso.\n",null,B.cB,null,null,null,null,null,null)
B.Uc=new A.a7("4.5. Enmienda o acondicionador org\xe1nico no h\xfamico s\xf3lido: Producto org\xe1nico s\xf3lido obtenido a partir de residuos de:\na) Plantas industriales.\nb) Plantas de tratamiento de aguas residuales agroindustriales y domiciliarias.\nc) Residuos s\xf3lidos urbanos separados en la fuente.\n\n4.6. Humus: Capa superior de los suelos que tiene actividad org\xe1nica, compuesto por productos de la descomposici\xf3n de la materia org\xe1nica por organismos como las lombrices y microorganismos como hongos y bacterias principalmente.\n\n4.7. Lombricompuesto: Material producido a partir de la digesti\xf3n natural de las lombrices, que utiliza la acci\xf3n conjunta de microorganismos para procesar material org\xe1nico en nutrientes, este es un mejorador de suelos.\n\n",null,B.f8,B.a4,null,null,null,null,null)
