B.Uh=new A.a7("4.8. Productos microbianos: Compuesto de microorganismos (bacterias u hongos), que han sido sometidos a un proceso de crecimiento masivo y producen un efecto de mejora de las condiciones del cultivo o de control de plagas.\n\n4.9. T\xe9 de compost: Extracto acuoso de composta y/o lombricomposta que permite que los microorganismos ben\xe9ficos crezcan en gran medida.\n\n",null,B.f8,B.a4,null,null,null,null,null)
B.Ul=new A.a7("1. Comercializar biopreparados sin registro ICA.\n\n2. Incluir dentro de la producci\xf3n de los biopreparados agr\xedcolas, mol\xe9culas consideradas como plaguicidas qu\xedmicos de uso agr\xedcola.\n\n3. Hacer publicidad a productos usando el nombre del ICA o sus signos distintivos para fines de promoci\xf3n comercial.\n\n4. Incluir informaci\xf3n no aprobada por el ICA en las etiquetas o la publicidad de productos en prensa, radio, hojas volantes, plegables u otro medio de comunicaci\xf3n.\n\n5. Producir biopreparados para uso agr\xedcola utilizando procedimientos o materiales que contengan organismos pat\xf3genos para el ambiente, la salud humana o la sanidad agropecuaria.\n",null,B.cB,null,null,null,null,null,null)
