B.UM=new A.a7("Objetos y definiciones",null,B.kB,null,null,null,null,null,null)
B.UO=new A.a7("4.1. Abono: Org\xe1nico a partir de la degradaci\xf3n microbiana de materiales, por descomposici\xf3n con microorganismos naturales presentes en el medio ambiente.\n\n4.2. Abono bocashi: Org\xe1nico obtenido en un proceso de fermentaci\xf3n con microorganismos que proporcionan nutrientes al suelo. La palabra bocashi es del idioma japon\xe9s que significa materia org\xe1nica fermentada.\n\n4.3. Compost: Producto final del compostaje por descomposici\xf3n biol\xf3gica de materiales org\xe1nicos a trav\xe9s de una maduraci\xf3n para convertirse en un recurso org\xe1nico estable y seguro para ser utilizado en la agricultura.\n\n4.4. Enmienda o acondicionador org\xe1nico h\xfamico: Producto org\xe1nico s\xf3lido de origen pedogen\xe9tico o geol\xf3gico con o sin tratamiento qu\xedmico.\n\n",null,B.f8,B.a4,null,null,null,null,null)
B.UP=new A.a7("Un lugar de f\xe1cil acceso es aquel ubicado estrat\xe9gicamente cerca de caminos principales o rutas transitables, con infraestructura adecuada para garantizar un ingreso r\xe1pido y sencillo, incluso en condiciones adversas. Debe facilitar el acceso a personas, veh\xedculos y materiales, contando con servicios cercanos como agua y energ\xeda, y estar adaptado para diferentes necesidades, optimizando tiempo y recursos.",null,B.cB,B.a4,null,null,null,null,null)
